import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const EventList = () => {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    // Fetch events from your backend or use dummy data
    const fetchedEvents = [
      {
        id: 1,
        eventName: 'Event 1',
        eventDate: '2024-03-20',
        eventReason: 'Reason 1',
        eventLocation: 'Location 1',
        eventTime: '10:00',
        guests: [
          { guestName: 'Guest 1', guestEmail: 'guest1@example.com', otherContact: 'Other 1' },
          { guestName: 'Guest 2', guestEmail: 'guest2@example.com', otherContact: 'Other 2' }
        ]
      },
      {
        id: 2,
        eventName: 'Event 2',
        eventDate: '2024-03-25',
        eventReason: 'Reason 2',
        eventLocation: 'Location 2',
        eventTime: '15:00',
        guests: [
          { guestName: 'Guest 3', guestEmail: 'guest3@example.com', otherContact: 'Other 3' },
          { guestName: 'Guest 4', guestEmail: 'guest4@example.com', otherContact: 'Other 4' }
        ]
      }
    ];

    setEvents(fetchedEvents);
  }, []);

  return (
    <div>
      <h2>Event List</h2>
      <ul>
        {events.map((event) => (
          <li key={event.id}>
            <strong>{event.eventName}</strong> - {event.eventDate} ({event.eventTime}) - {event.eventLocation}
            <ul>
              {event.guests.map((guest, index) => (
                <li key={index}>
                  {guest.guestName} ({guest.guestEmail})
                </li>
              ))}
            </ul>
          </li>
        ))}
      </ul>
      <Link to="/add-event" className="button-64">
        <span className="text">Add Event</span>
      </Link>
    </div>
  );
};

export default EventList;
